// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import React Router components
import './App.css';
import Navbar from './components/Navbar'; // Import Navbar component
import Bio from './components/Bio'; // Import Bio component
import Experience from './components/Experience'; // Import Experience component
import Projects from './components/Projects'; // Import Projects component
import Contact from './components/Contact'; // Import Contact component

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar /> {/* The Navbar stays persistent across all routes */}
        <Routes>
          {/* Define routes for each section */}
          <Route path="/" element={<Bio />} /> {/* Set Bio as the home page */}
          <Route path="/experience" element={<Experience />} /> {/* Experience route */}
          <Route path="/projects" element={<Projects />} /> {/* Projects route */}
          <Route path="/contact" element={<Contact />} /> {/* Contact route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
